    ) internal view returns (bool) {
        // added time
        uint256 openingTime = ITimeHelper(collection).getOpeningTime(tokenId);
        uint256 closingTime = ITimeHelper(collection).getClosingTime(tokenId);

        // // not setup yet
        // if (openingTime == 0) {
        //     return false;
        // }

        if (closingTime - openingTime >= extraTime) {
            return true;
        }

        return false;
    }

